import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FiTruck, FiSave, FiArrowLeft } from 'react-icons/fi';
import { Button } from '../../styles/GlobalStyles';
import { 
  PageContainer,
  PageHeader,
  PageTitle,
  HeaderActions,
  BackButton,
  FormCard,
  FormGrid,
  FormGroup,
  Label,
  Input,
  ErrorMessage
} from '../../components/Common/CommonStyles';
import { Vehicle, VehicleModel } from '../../types';
import { dataService } from '../../services/dataService';
import VehicleModelSearchDropdown from '../../components/UI/VehicleModelSearchDropdown';

interface VehicleFormData {
  plateNo: string;
  fleetNo: string;
  vehicleModel: VehicleModel | null;
}

const CreateVehicle: React.FC = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState<VehicleFormData>({
    plateNo: '',
    fleetNo: '',
    vehicleModel: null
  });
  const [errors, setErrors] = useState<Partial<VehicleFormData>>({});
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));

    // Clear error when user starts typing
    if (errors[name as keyof VehicleFormData]) {
      setErrors(prev => ({ ...prev, [name]: undefined }));
    }
  };

  const validateForm = (): boolean => {
    const newErrors: Partial<VehicleFormData> = {};

    if (!formData.plateNo.trim()) {
      newErrors.plateNo = 'Plate number is required';
    }

    if (!formData.fleetNo.trim()) {
      newErrors.fleetNo = 'Fleet number is required';
    }

    if (!formData.make.trim()) {
      newErrors.make = 'Make is required';
    }

    if (!formData.model.trim()) {
      newErrors.model = 'Model is required';
    }

    if (!formData.year.trim()) {
      newErrors.year = 'Year is required';
    } else {
      const yearNum = parseInt(formData.year);
      if (isNaN(yearNum) || yearNum < 1900 || yearNum > new Date().getFullYear() + 1) {
        newErrors.year = 'Please enter a valid year';
      }
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!validateForm()) {
      return;
    }

    setIsSubmitting(true);

    try {
      const vehicleData = {
        ...formData,
        year: parseInt(formData.year)
      };

      await dataService.createVehicle(vehicleData);
      navigate('/vehicles');
    } catch (error) {
      console.error('Error creating vehicle:', error);
      alert('Failed to create vehicle. Please try again.');
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleCancel = () => {
    navigate('/vehicles');
  };

  return (
    <PageContainer className="fade-in">
      <PageHeader>
        <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
          <BackButton onClick={handleCancel}>
            <FiArrowLeft size={18} />
          </BackButton>
          <PageTitle>Create New Vehicle</PageTitle>
        </div>
        <HeaderActions>
          <Button variant="secondary" onClick={handleCancel} disabled={isSubmitting}>
            Cancel
          </Button>
          <Button 
            variant="primary" 
            onClick={handleSubmit}
            disabled={isSubmitting}
          >
            <FiSave />
            {isSubmitting ? 'Creating...' : 'Create Vehicle'}
          </Button>
        </HeaderActions>
      </PageHeader>

      <FormCard>
        <form onSubmit={handleSubmit}>
          <FormGrid>
            <FormGroup>
              <Label htmlFor="plateNo">Plate Number *</Label>
              <Input
                type="text"
                id="plateNo"
                name="plateNo"
                value={formData.plateNo}
                onChange={handleInputChange}
                placeholder="e.g., ABC-123"
                hasError={!!errors.plateNo}
              />
              {errors.plateNo && <ErrorMessage>{errors.plateNo}</ErrorMessage>}
            </FormGroup>

            <FormGroup>
              <Label htmlFor="fleetNo">Fleet Number *</Label>
              <Input
                type="text"
                id="fleetNo"
                name="fleetNo"
                value={formData.fleetNo}
                onChange={handleInputChange}
                placeholder="e.g., FL001"
                hasError={!!errors.fleetNo}
              />
              {errors.fleetNo && <ErrorMessage>{errors.fleetNo}</ErrorMessage>}
            </FormGroup>

            <FormGroup>
              <Label htmlFor="make">Make *</Label>
              <Input
                type="text"
                id="make"
                name="make"
                value={formData.make}
                onChange={handleInputChange}
                placeholder="e.g., Toyota"
                hasError={!!errors.make}
              />
              {errors.make && <ErrorMessage>{errors.make}</ErrorMessage>}
            </FormGroup>

            <FormGroup>
              <Label htmlFor="model">Model *</Label>
              <Input
                type="text"
                id="model"
                name="model"
                value={formData.model}
                onChange={handleInputChange}
                placeholder="e.g., Camry"
                hasError={!!errors.model}
              />
              {errors.model && <ErrorMessage>{errors.model}</ErrorMessage>}
            </FormGroup>

            <FormGroup>
              <Label htmlFor="year">Year *</Label>
              <Input
                type="number"
                id="year"
                name="year"
                value={formData.year}
                onChange={handleInputChange}
                placeholder="e.g., 2023"
                min="1900"
                max={new Date().getFullYear() + 1}
                hasError={!!errors.year}
              />
              {errors.year && <ErrorMessage>{errors.year}</ErrorMessage>}
            </FormGroup>
          </FormGrid>
        </form>
      </FormCard>
    </PageContainer>
  );
};

export default CreateVehicle;
